import React, { Component } from 'react'
import axios from 'a'
export default class Results extends Component {
    constructor(props){
        
        super(props);
        this.state = {
            what: this.props.match.params.what,
            where: this.props.match.params.where,
            items: [],
            isLoaded: false
        }
    }
    componentDidMount(){
        fetch('localhost:5001/locals')
            .then(res => res.json())
            .then(json => {
                this.setState({
                    isLoaded: true,
                    items: json
                });
            })
    }
    render() {
        
        return (
            <div>
                <h1>What: {this.state.what}</h1>
                <h1>Where: {this.state.where}</h1>
                <ul>
                    this.state.items.map(item => {
                        <li>
                            item
                        </li>
                    })
                </ul>
            </div>
        )
    }
}
